-- ----------------------------
-- Table structure for bak__cash_record_import
-- ----------------------------
DROP TABLE IF EXISTS `bak__cash_record_import`;
CREATE TABLE `bak__cash_record_import` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `order_sn` varchar(32) NOT NULL DEFAULT '' COMMENT '流水号，如果是游戏服务端操作，写每一局ID',
  `uid` int(11) NOT NULL DEFAULT '0' COMMENT '玩家ID',
  `user_name` varchar(30) NOT NULL COMMENT '玩家名称',
  `agent_id` int(11) NOT NULL DEFAULT '0' COMMENT '代理id',
  `hall_id` int(11) NOT NULL DEFAULT '0' COMMENT '厅主id',
  `type` int(11) NOT NULL COMMENT '操作类型,1转帐,2打赏,3优惠退水,4线上变更,5公司入款,6优惠冲销,7视讯派彩,8系统取消出款,9系统拒绝出款,21旗舰厅下注，22为至尊厅下注，23为金臂厅下注，24为贵宾厅下注,31视讯取消退回,32旗舰厅取消退回,33金臂厅取消退回,34至尊厅取消退回',
  `amount` decimal(16,2) NOT NULL DEFAULT '0.00' COMMENT '加减的金额',
  `status` tinyint(2) DEFAULT '0' COMMENT '加减状态，3是加，4是减',
  `user_money` decimal(16,2) DEFAULT NULL COMMENT '操作完后用户余额',
  `desc` varchar(255) DEFAULT NULL COMMENT '备注',
  `admin_user` varchar(45) NOT NULL DEFAULT '' COMMENT '操作用户名',
  `admin_user_id` int(11) NOT NULL DEFAULT '0' COMMENT '操作用户ID',
  `cash_no` varchar(50) NOT NULL DEFAULT '' COMMENT '发牌端生成的某一局唯一ID',
  `add_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '添加时间',
  `pkey` varchar(50) DEFAULT '' COMMENT '用于校验记录是否被修改,MD5(uid+cash_no+amount)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=949 DEFAULT CHARSET=utf8 COMMENT='现金记录表(会用nosql替换)';

