-- Records of bak__cash_record_import
-- ----------------------------

-- ----------------------------
-- Table structure for lb_agent_user_import
-- ----------------------------
DROP TABLE IF EXISTS `lb_agent_user_import`;
CREATE TABLE `lb_agent_user_import` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `user_name` char(45) NOT NULL COMMENT '登录名',
  `password` varchar(100) NOT NULL,
  `salt` varchar(20) DEFAULT NULL COMMENT '密码加密盐值，8-20位随机数，随机数为字母和数字组合',
  `real_name` char(45) DEFAULT NULL COMMENT '用户名',
  `desc` varchar(45) DEFAULT NULL COMMENT '描述',
  `grade_id` tinyint(5) NOT NULL DEFAULT '0' COMMENT '代理级别，总代则为1，2为二级代理',
  `is_hall_sub` tinyint(1) NOT NULL DEFAULT '0' COMMENT '是否为厅主子账号 0：否，1：是，默认为0',
  `tel` varchar(20) DEFAULT NULL COMMENT '手机号',
  `account_state` tinyint(6) NOT NULL DEFAULT '1' COMMENT '1为正常,2为停用,3为删除',
  `add_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `ip_info` varchar(20) DEFAULT NULL COMMENT '注册IP地址',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '上级代理ID',
  `mapping` varchar(45) DEFAULT NULL COMMENT '代理分类路径',
  `sub_count` smallint(6) NOT NULL DEFAULT '0' COMMENT '有几个下级代理,代理数',
  `area` varchar(45) DEFAULT NULL COMMENT '运营地区',
  `tel_pre` char(15) NOT NULL DEFAULT '' COMMENT '手机国家代码',
  `email` char(45) DEFAULT NULL COMMENT 'email邮箱',
  `account_lock` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否锁定,1锁定（锁定其下代理或玩家）,0不锁定',
  `lock_rank` tinyint(3) DEFAULT NULL COMMENT '该字段暂时不用，1为锁定其下级代理商，2:为锁定其下子账户,3为锁定其下级玩家',
  `charge_mode` tinyint(3) DEFAULT NULL COMMENT '1为固定收费,2为分享报表流水',
  `charge_fixed` int(11) DEFAULT NULL COMMENT '固定收费百分比,入库记录为整数',
  `charge_percentage` int(11) DEFAULT NULL,
  `time_zone` varchar(45) DEFAULT NULL,
  `lang_code` char(20) DEFAULT NULL COMMENT '语言代码,如简体中文为zh-cn',
  `sub_user` int(11) DEFAULT '0' COMMENT '玩家数',
  `lock_reason` varchar(45) DEFAULT '' COMMENT '锁定原因',
  `account_type` tinyint(3) DEFAULT '1' COMMENT '账号种类,1为正常账号,2为测试账号，3为调试账号',
  `agent_code` varchar(100) DEFAULT '' COMMENT '代理商code，做为代理商玩家用户名前缀',
  `t_id` int(11) NOT NULL DEFAULT '0' COMMENT '游戏模板id',
  `group_id` tinyint(1) NOT NULL DEFAULT '0' COMMENT '权限分组ID',
  `notify_url` varchar(100) DEFAULT NULL COMMENT '第三方通知URL',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id_UNIQUE` (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='代理商账号表';

-- ----------------------------
-- Records of lb_agent_user_import
-- ----------------------------

-- ----------------------------
-- Table structure for lb_user_import
-- ----------------------------
DROP TABLE IF EXISTS `lb_user_import`;
CREATE TABLE `lb_user_import` (
  `uid` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_name` varchar(45) NOT NULL DEFAULT '' COMMENT '玩家在第三方平台账号，带前缀',
  `password` varchar(100) NOT NULL DEFAULT '',
  `username_md` varchar(45) NOT NULL DEFAULT '' COMMENT '玩家在平台的账号',
  `password_md` varchar(100) DEFAULT '' COMMENT '玩家在平台账号密码',
  `password_mb_c` varchar(45) DEFAULT NULL COMMENT '手机字符密码',
  `password_mb_s` varchar(45) DEFAULT '' COMMENT '手机手势登录密码',
  `salt` varchar(20) DEFAULT NULL COMMENT '密码加密盐值，8-20位随机数，随机数为字母和数字组合',
  `user_rank` tinyint(3) DEFAULT '0' COMMENT '用户等级，1为测试玩家，0为正常账号,2为管理员测试账号',
  `alias` varchar(45) NOT NULL DEFAULT '' COMMENT '玩家昵称',
  `add_date` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '注册时间',
  `create_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '创建时间',
  `last_time` datetime NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最后一次登录时间',
  `add_ip` varchar(20) NOT NULL DEFAULT '0.0.0.0' COMMENT '注册IP',
  `ip_info` varchar(20) NOT NULL DEFAULT '0.0.0.0' COMMENT '登录IP',
  `on_line` char(1) NOT NULL DEFAULT 'N' COMMENT '是否在线',
  `account_state` tinyint(3) NOT NULL DEFAULT '1' COMMENT '账号状态,1为正常（启用）,2为暂停使用（冻结）,3为停用',
  `hall_id` int(11) NOT NULL DEFAULT '0' COMMENT '厅主ID',
  `agent_id` int(11) NOT NULL DEFAULT '0' COMMENT '代理商ID',
  `hall_name` varchar(32) NOT NULL DEFAULT '' COMMENT '厅主登录名',
  `agent_name` varchar(45) DEFAULT '' COMMENT '代理商名称',
  `mapping` varchar(45) DEFAULT NULL COMMENT '分类路径',
  `profit_share_platform` varchar(6) DEFAULT NULL COMMENT '平台分成',
  `profit_share_agent` varchar(6) NOT NULL DEFAULT '0' COMMENT '代理商分成',
  `profit_share_hall` varchar(6) NOT NULL DEFAULT '0' COMMENT '厅主(总代理)分成',
  `money` decimal(20,2) NOT NULL DEFAULT '0.00' COMMENT '当前用户余额',
  `token_id` varchar(50) DEFAULT NULL COMMENT 'session_id',
  `language` varchar(45) DEFAULT NULL,
  `last_update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '最后更新时间（余额）',
  PRIMARY KEY (`uid`),
  UNIQUE KEY `uid_UNIQUE` (`uid`) USING BTREE,
  KEY `index_user_name` (`user_name`) USING BTREE,
  KEY `index_add_date` (`add_date`) USING BTREE,
  KEY `index_account_state` (`account_state`) USING BTREE,
  KEY `index_hall_id` (`hall_id`) USING BTREE,
  KEY `index_agent_id` (`agent_id`) USING BTREE,
  KEY `index_agent_name` (`agent_name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=345 DEFAULT CHARSET=utf8 COMMENT='玩家用户表';

-- ----------------------------
-- Records of lb_user_import
-- ----------------------------
